import React from "react";
import ImageSection from "./ImageSection";
import SideBar from "./SideBar";

import "./AppBody.css";

const AppBody = () => {
  return (
    <div className="app-body-wrapper">
      <div className="image-div">
        <ImageSection />
      </div>
      <div className="sidebar-div">
        <SideBar />
      </div>
    </div>
  );
};

export default AppBody;
